import React from "react";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Rent from "../../pages/Rent";
import Login from "../../pages/Login";
import Registration_Customer from "../../pages/Registration_Customer";
import Registration_Rental_Agency from "../../pages/Registration_Rental_Agency";

import { BrowserRouter as Router, Route } from "react-router-dom";

function Navbar_Home() {
  const handleSelect = (eventKey) => alert(`selected ${eventKey}`);

  return (
    <Router>
      <div>
        <Nav bg="dark" variant="pills" activeKey="1" onSelect={handleSelect}>
          <Nav.Item>
            <Nav.Link to={"/rent"}>Rent</Nav.Link>
          </Nav.Item>

          <NavDropdown title="Login" id="nav-dropdown">
            <NavDropdown.Item>
              <Nav.Link to={"/login"}> Renter</Nav.Link>
            </NavDropdown.Item>

            <NavDropdown.Item>Rental Agency</NavDropdown.Item>
          </NavDropdown>

          <NavDropdown title="Register" id="nav-dropdown">
            <NavDropdown.Item>
              <Nav.Link to={"/registration/customer"}>Renter</Nav.Link>
            </NavDropdown.Item>
            <NavDropdown.Item>
              <Nav.Link to={"/registration/rental_agency"}>
                Rental Agency
              </Nav.Link>
            </NavDropdown.Item>
          </NavDropdown>
        </Nav>
      </div>
      <div>
        <Route path="/rent" component={Rent}></Route>
        <Route path="/login" component={Login}></Route>
        <Route
          path="/registration/customer"
          component={Registration_Customer}
        ></Route>
        <Route
          path="/registration/rental_agency"
          component={Registration_Rental_Agency}
        ></Route>
      </div>
    </Router>
  );
}

export default Navbar_Home;
